import React from 'react'

const Pods = ({pods}) => {  
return (
    <div>
      <center><h1>Pod List</h1></center>
      {!pods ? Object.keys(pods).map(key => <Pods key={key} body={pods[key]} />) : <h3>Loading...</h3>}
            {/* <div>{pods}</div> */}

    </div>
  )
};

export default Pods
